//ACCORDION MENU
.accordion {
    display: none;
}
.accordion-btn {
    display: block;
    width: 100%;
    padding: 15px;
    border: none;
    border-bottom: 1px solid #c1c3c6;
    outline: none;
    cursor: pointer;
    text-align: left;
    font-size: 24px;
    line-height: 32px;
    font-weight: 900;
    letter-spacing: -0.25px;
    background-color: white;
}
.accordion-btn::after {
    content: '\25be';
    float: right;
    transform: scale(1.0);
    color: #c1c3c6;
}
.active {
    background-color: white;  
}
.active::after {
    content: '\25b4';
}
.accordion-content {
    overflow: hidden;
    max-height: 0;
    transition: max-hight 400ms;
    padding: 0 15px;
    background-color:#EEEEEE;
    transition: all 200ms ease-in-out;
}
.accordion-content ul {
    list-style: none;
}
.accordion-content li {
    margin: 10px 0px;
}
.accordion-content li a {
    text-decoration: none;
    color: #2D46B9;
    font-size: 18px;
    font-weight: 700;
    line-height: 1.5;

    &:hover {
        color: #1D4C85;
    }
}



.community {
    padding: 80px 16px;
    line-height: 1.5;
    text-align: center;

    h1 {
        font-size: 48px;
        line-height: 56px;
        padding: 0px 0px 0.67em;
        font-weight: 900;
        letter-spacing: -1px;
    }
    p {
        max-width: 500px;
        margin: 0 auto 16px;
        font-size: 18px;
        padding: 0px 0px 1em;
        font-weight: 400;
        line-height: 24px;
    }
}
.community button {
    cursor: pointer;
    border: none;
    border-radius: 500px;
    font-size: 14px;
    font-weight: 700;
    letter-spacing: 2px;
    line-height: 1;
    padding: 17px 48px;
    background-color: rgb(45, 70, 185);
    color: white;
    transition: scale 200ms ease-in-out;

    &:hover {
        transform: scale(1.04);
        opacity: 0.8;
    }
}
.links img {
    width: 132px;
}











@media (max-width: 990px) {
    .top-solutions {
